// components/navbar.jsx
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
    const navigate = useNavigate();
    const [balance, setBalance] = useState(0); // Default balance
    const [modalType, setModalType] = useState(null); // 'withdraw' or 'deposit'
    const [amount, setAmount] = useState('');

    const handleLogout = () => {
        localStorage.removeItem('Token');
        localStorage.removeItem('User');
        navigate('/');
    };

    const handleModalSubmit = async () => {
        if (!amount || isNaN(amount) || amount <= 0) {
            alert('Please enter a valid amount.');
            return;
        }

        try {
            const response = await fetch(`/api/${modalType}`, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    Authorization: `Bearer ${localStorage.getItem('Token')}`,
                },
                body: JSON.stringify({ amount: parseFloat(amount) }),
            });

            if (response.ok) {
                const updatedBalance = await response.json();
                setBalance(updatedBalance.balance);
                alert(`${modalType === 'withdraw' ? 'Withdrawn' : 'Deposited'} successfully!`);
                setModalType(null); // Close modal
                setAmount('');
            } else {
                alert('Transaction failed.');
            }
        } catch (error) {
            console.error('Error during transaction:', error);
            alert('An error occurred.');
        }
    };

    return (
        <>
            <nav
                style={{
                    display: 'flex',
                    flexDirection: 'row',
                    justifyContent: 'space-between',
                    padding: '10px',
                    borderBottom: '1px solid #ccc',
                }}
            >
                <Link
                    to="/panel/projects"
                    style={{
                        marginRight: '15px',
                        textDecoration: 'none',
                        fontSize: '24px',
                        color: 'black',
                        alignSelf: 'center',
                    }}
                >
                    DIAMOND
                </Link>
                <div style={{display: 'flex', flexDirection: 'row', justifyContent: 'end', alignItems: 'center'}}>
                    <button
                        style={{
                            marginRight: '5px',
                            border: '1px solid black',
                            borderRadius: '50%',
                            minWidth: '30px',
                            width: '30px',
                            height: '30px',
                            textAlign: 'center',
                            lineHeight: '0px',
                            fontSize: '16px',
                            cursor: 'pointer',
                        }}
                        onClick={() => setModalType('withdraw')}
                    >
                        -
                    </button>
                    <span style={{marginRight: '10px', fontSize: '17px', whiteSpace: 'nowrap'}}>
                        Balance: {balance} USD
                    </span>
                    <button
                        style={{
                            marginRight: '50px',
                            border: '1px solid black',
                            borderRadius: '50%',
                            width: '30px',
                            height: '30px',
                            textAlign: 'center',
                            lineHeight: '10px',
                            fontSize: '16px',
                            cursor: 'pointer',
                        }}
                        onClick={() => setModalType('deposit')}
                    >
                        +
                    </button>
                    <Link
                        to="/panel/profile"
                        style={{
                            marginRight: '15px',
                            textDecoration: 'none',
                            fontSize: '17px',
                            color: 'black',
                            alignSelf: 'center',
                        }}
                    >
                        Profile
                    </Link>
                    <button style={{maxWidth: '100px'}} onClick={handleLogout}>
                        Log Out
                    </button>
                </div>
            </nav>

            {modalType && (
                <div
                    style={{
                        position: 'fixed',
                        top: 0,
                        left: 0,
                        width: '100%',
                        height: '100%',
                        backgroundColor: 'rgba(0, 0, 0, 0.5)',
                        display: 'flex',
                        justifyContent: 'center',
                        alignItems: 'center',
                    }}
                >
                    <div
                        style={{
                            backgroundColor: 'white',
                            padding: '20px',
                            borderRadius: '10px',
                            width: '300px',
                            textAlign: 'center',
                        }}
                    >
                        <h2>{modalType === 'withdraw' ? 'Withdraw' : 'Deposit'}</h2>
                        <input
                            type="number"
                            value={amount}
                            onChange={(e) => setAmount(e.target.value)}
                            style={{ width: '100%', padding: '10px', marginBottom: '15px' }}
                            placeholder="Enter amount"
                        />
                        <button
                            onClick={handleModalSubmit}
                            style={{ padding: '10px 20px', marginRight: '10px' }}
                        >
                            Submit
                        </button>
                        <button
                            onClick={() => setModalType(null)}
                            style={{ padding: '10px 20px' }}
                        >
                            Cancel
                        </button>
                    </div>
                </div>
            )}
        </>
    );
};

export default Navbar;
